import Button from "./button";
import { GoBell, GoCloudDownload, GoDatabase } from 'react-icons/go'

function App() {
    const onClickHandler = () => {
        console.log('Button clicked')
    }
    return <div>
        <div><Button success rounded onClick={onClickHandler}><GoBell/> click me</Button></div>
        <div><Button danger>HIIIII!!</Button></div>
        <div><Button warning rounded>NOPE</Button></div>
        <div><Button outline secondary >SHOP <GoDatabase/></Button></div>
        <div><Button rounded outline secondary ><GoCloudDownload /> KLOPP!!</Button></div>
        
    </div>
}

export default App;
